import { useState } from "react";

import Modal from "../UI/Modal";

const Cart = (props) => {
  const [cartVisible, setCartVisible] = useState(true);

  const hideCartHandler = (props) => {
    setCartVisible(false);
  };

  return (
    <Modal>
      <h3>Sushi</h3>
      <h4>12.99</h4>
      <button onClick={hideCartHandler}>Close</button>
    </Modal>
  );
};
export default Cart;
